// import PropTypes from "prop-types";

const Slideshow = (props) => {
  return (
    <div>
      <img src="/assets/images/builds_group_pic_1.jpg" alt="A group of students" />
    </div>
  );
};

Slideshow.propTypes = {};

export default Slideshow;
